import React from "react";
import { useState } from "react";

const initialcount = 0
const initialuser = { name: "", password: "" }
const UseState = () => {
    const [count, setCount] = useState(initialcount)
    const [user, setUser] = useState(initialuser)
    const Count = () => {
        setCount(count + 1)
    }
    const Change = (e) =>{
        setUser(e.target.value)
    }
    const Submit = () => {
        setUser(user)
        console.log(user)
    }
    return (
        <div>
            <div> count : {count}</div>
            <button type="button" onClick={Count}>Count</button><br></br>

            name:<input type="text" value={user.name} onChange={Change} /><br></br>
            password:<input type="password" value={user.password} onChange={Change} /><br></br>
            <button type="btn" onClick={Submit}>submit</button>

        </div>
    )
}
export default UseState
